import React from 'react';

const Header = () => {
    return (
        <header style={styles.header}>
            <h1 style={styles.title}>TodoList</h1>
        </header>
    );
};

const styles = {
    header: {
        backgroundImage: 'url("https://images.unsplash.com/photo-1519183071298-a2962be1c451")', // Example background image URL related to notes
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        padding: '40px 0',
        textAlign: 'center',
        borderBottom: '4px solid #61dafb',
    },
    title: {
        color: 'white',
        fontSize: '3rem',
        margin: 0,
        textShadow: '2px 2px 8px rgba(0, 0, 0, 0.7)',
    },
};

export default Header;
